import React, { useState, Component } from 'react';

import styled from 'styled-components';

const Div = styled.h1`
  margin: 500px 0 0 0;
  color: red;
`;

function Home() {
  return (
    <>
      <Div>Welcome to Next.js!</Div>
      <div>test</div>
    </>
  );
}

export default Home;
